import './App.css';

function App() {
  return (
    <div className="Home-menu">
      <header className="App-header">
        <button className="mmButton">To-Do List</button>
        <br></br><br></br>
        <button className="mmButton">Daily Schedule Tracker</button>
      </header>
    </div>
  );
}

export default App;
